import React from 'react'
import { inject, observer } from 'mobx-react'
import Link from 'next/link';
import '../styles/style.scss'

@inject('store')
@observer
class Page extends React.Component {
    render() {
        console.log(this.props);

        return (
            <div>
                <div classNameName='container'>
                    <h1 classNameName='example'>{this.props.store.message}</h1>
                </div>
                <h2 classNameName='example'>ASDASD</h2>
                <Link href='/other'>
                    <a>Other</a>
                </Link>
                <br />
                <div className="card bg-light mb-3 max-width">
                    <div className="card-header">Header</div>
                    <div className="card-body">
                        <h5 className="card-title">Light card title</h5>
                        <p className="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                    </div>
                </div>
                <hr />
                <button onClick={() => this.props.store.changeMessage('ASDasdasd')} type='button'>Click me!</button>
            </div>
        )
    }
}

export default Page
